import React, { useState, useEffect } from 'react';
import getClientAuthToken from './api/getClientAuthToken';
import getResource from './api/getResource';
import './App.css';

const App = () => {
  const [clientAuthToken, setClientAuthToken] = useState({});
  const [tempData, setTempData] = useState("");

  useEffect(() => {
    getClientAuthToken()
      .then(function(clientAuthToken) {
        setClientAuthToken(clientAuthToken);
      })
      .catch(function(error) {
        console.log(error);
        throw new Error(error.message);
      });
  }, []);


  const handleOnClick = () => {
    getResource(clientAuthToken, "item-class/index")
      .then(function(response) {
        setTempData(JSON.stringify(response));
      })
      .catch(function(error) {
        console.log(error);
      });
  };




  return (
    <div className="App">
      <button
        onClick={handleOnClick}
      >
        Click Me
      </button>
      <div>
        {tempData}

      </div>
    </div>
  );
};

export default App;
